/** @format */

import styled from "styled-components";

function Header() {
  return (
    <HeaderWrapper>
      <Logo>
        <a>
          <img src="./images/logo.svg" alt="Tesla Logo"></img>
        </a>
      </Logo>
      <Menu>
        <p>
          <a href="#">Model S</a>
        </p>
        <p>
          <a href="#">Model 3</a>
        </p>
        <p>
          <a href="#"> Model X</a>
        </p>
        <p>
          <a href="#">Model Y</a>
        </p>
        <p>
          <a href="#">Solar Roof</a>
        </p>
        <p>
          <a href="#">Solar Panles</a>
        </p>
      </Menu>
    </HeaderWrapper>
  );
}

export default Header;

const Logo = styled.div``;

const HeaderWrapper = styled.div`
  max-width: 81rem;
  min-height: 60px;
  position: fixed; //sticky header
  display: flex;
  align-items: center;
  padding: 0 20px;
`;

const Menu = styled.div`
  display: flex;
  align-items: center;
  background-color: grey;
  margin: 000 2rem;

  P {
    font-weight: 600;
    transform: scale(1.2);
    margin-right: 1rem;
  }
`;
